    double[] genData(int d, int N) {

        Random r = new Random(1);

        double[] result = new double[d * N];

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < d; j++) {
                result[N * j + i] = r.nextInt(2000) / 1000.;

            }
        }

        return result;
    }

    @Test
    public void testSetup() {
        System.out.println("setup");
        int d = 5;
        float bandwidth = 0.7F;
        double epsilen = 1e-3;
        int Klim = 6;
        int N = 1000;
        double[] X =genData(d, N);

        IFGTProxy instance = new IFGTProxy();
        instance.setup(d, bandwidth, epsilen, Klim, X, N);

        int M = 1000;
        double[] Y = genData(d, M);
        double[] weigths = new double[N];

        for (int i = 0; i < weigths.length; i++) {
            weigths[i] = 1;

        }

        double[] gausresult = new double[M];

        instance.eval(Y, M, weigths, gausresult);

        for (int i = 0; i < gausresult.length; i++) {
            System.out.println(gausresult[i]);

        }

        instance.delete();



    }


